import React from 'react'
import { Container, Row } from 'react-bootstrap'

const Eventos = () => {
  return (
    <Container>
      <Row className='text-center'>
        <h1>EVENTOS</h1>
      </Row>
    </Container>
  )
}

export default Eventos
